      this.state = this.manually.state;
      this.zip_code = this.manually.zip_code;
      this.lat = this.manually.lat;
      this.lng = this.manually.lng;

      this.emitData();

      this.createMap({lat: this.lat, lng: this.lng}, this.manually.zoom);
